import React from 'react';

const TriColumnSection = ({ title, items }) => {
  return (
    <div className="tricolumn-section">
      <h2>{title}</h2>
      <div className="tricolumn-container">
        <div className="tricolumn">
          {items.slice(0, Math.ceil(items.length / 3)).map((item, index) => (
            <div key={index}>{item}</div>
          ))}
        </div>
        <div className="tricolumn">
          {items.slice(Math.ceil(items.length / 3), Math.ceil((items.length / 3) * 2)).map((item, index) => (
            <div key={index}>{item}</div>
          ))}
        </div>
        <div className="tricolumn">
          {items.slice(Math.ceil((items.length / 3) * 2)).map((item, index) => (
            <div key={index}>{item}</div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TriColumnSection;
